import React from 'react';

class List extends React.Component {
    state = {
        linguagens: []
    };

    componentDidMount() {
        fetch('http://192.168.0.10:3000/view/listar.php')
            .then(res => res.json())
            .then(res => {
                this.setState({
                    linguagens: res
                });
            });
    }

    render() {
        return (
            <div>
                <h1>Lista de Livros</h1>

                <ul>
                    {this.state.linguagens.map(item => (
                        <li key={item.id}>
                            <p><b>TÃ­tulo:</b> {item.titulo}</p>
                            <p><b>Autor:</b> {item.autor}</p>
                        </li>
                    ))}
                </ul>
            </div>
        );
    }
}

export default List;
